import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <Link to='/'>Home</Link>
      <Link to='/schedule'>Schedule a Post</Link>
      <Link to='/posts'>View Posts</Link>
    </nav>
  );
}

export default Navbar;
